import React from 'react'
import { navigationMenu } from './NavigationMenu'
import { useNavigate } from 'react-router-dom'
import { Avatar, Button } from '@mui/material';
import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import { useDispatch, useSelector } from 'react-redux';
import { store } from '../../Store/store';
import { logout } from '../../Store/Auth/Action';


const Navigation = () => {
    const { auth } = useSelector(store => store)

    const [anchorEl, setAnchorEl] = React.useState(null);
    const dispatch = useDispatch();
    const open = Boolean(anchorEl);
    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };
    const handleClose = () => {
        setAnchorEl(null);
    };
    const navigate = useNavigate();
    const handleLogout = () => {
        console.log("logout")
        handleClose()// to also cloe the menu we have given handle close here
        dispatch(logout())
    }
    return (
        <div className='h-screen sticky top-0'>
            <div classnName="py-5">
                <svg height="20" width="300" xmlns="http://www.w3.org/2000/svg" shape-rendering="geometricPrecision" text-rendering="geometricPrecision" image-rendering="optimizeQuality" fill-rule="evenodd" clip-rule="evenodd"
                    viewBox="0 0 512 462.799"><path fill-rule="nonzero" d="M403.229 0h78.506L310.219 196.04 512 462.799H354.002L230.261 301.007 88.669 462.799h-78.56l183.455-209.683L0 0h161.999l111.856 147.88L403.229 0zm-27.556 415.805h43.505L138.363 44.527h-46.68l283.99 371.278z" /></svg>
                <div className='space-y-6'>
                    {navigationMenu.map((item) => <div className='cursor-pointer flex space-x-3 items-center' onClick={() => item.title === "Profile" ? navigate(`/profile/${auth.user?.id}`) : navigate(item.path)}>
                        {item.icon}
                        <p className='text-x1'>{item.title}</p> {/* increase size of text */}
                    </div>)}
                </div>
                <div className='py-10'>
                    <Button sx={{ width: "100%", borderRadius: "29px", py: "15px", bgcolor: "blue" }} variant='contained' >
                        tweet
                    </Button>
                </div>
            </div>
            <div className="flex item-center justify-between">
                <div className="flex item-center space-x-3">
                    <Avatar alt="username" src="data:image/png;base64,"></Avatar>
                    <div><p>{auth.user?.fullName}</p>
                        <span className='opacity-80'> @{auth.user?.fullName.split(" ").join("_").toLowerCase()}</span>
                    </div>
                    <Button
                        id="basic-button"
                        aria-controls={open ? 'basic-menu' : undefined}
                        aria-haspopup="true"
                        aria-expanded={open ? 'true' : undefined}
                        onClick={handleClick}
                    >
                        <MoreHorizIcon />

                    </Button>
                    <Menu
                        id="basic-menu"
                        anchorEl={anchorEl}
                        open={open}
                        onClose={handleClose}
                        MenuListProps={{
                            'aria-labelledby': 'basic-button',
                        }}
                    >
                        <MenuItem onClick={handleClose}>Profile</MenuItem>
                        <MenuItem onClick={handleClose}>My account</MenuItem>
                        <MenuItem onClick={handleLogout}>Logout</MenuItem>
                    </Menu>
                </div>
            </div>

        </div >

    )
}

export default Navigation
